import React, { useEffect, useState } from 'react';
import axios from 'axios';
import toast from 'react-hot-toast';
import Modal from 'react-modal';

Modal.setAppElement('#root'); // This is for accessibility reasons, it binds the modal to your app's root element

function PatientDashboard() {
  const [doctors, setDoctors] = useState([]);
  const [selectedDoctor, setSelectedDoctor] = useState(null);
  const [appointmentDate, setAppointmentDate] = useState('');
  const [isModalOpen, setIsModalOpen] = useState(false);

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        const res = await axios.get('http://127.0.0.1:5000/api/user/doctors');
        if (res.data.success) {
          setDoctors(res.data.data);
        } else {
          toast.error('Failed to fetch doctors');
        }
      } catch (error) {
        console.error(error);
        toast.error('Server Error');
      }
    };

    fetchDoctors();
  }, []);

  const handleBookAppointment = async () => {
    try {
      const token = localStorage.getItem('token');
      const res = await axios.post(
        'http://127.0.0.1:5000/api/user/book-appointment',
        {
          doctorId: selectedDoctor,
          appointmentDate,
        },
        {
          headers: { Authorization: `Bearer ${token}` },
        }
      );
      if (res.data.success) {
        toast.success(res.data.message);
        setSelectedDoctor(null);
        setAppointmentDate('');
        setIsModalOpen(false);
      } else {
        toast.error(res.data.message);
      }
    } catch (error) {
      console.error(error);
      toast.error('Booking failed');
    }
  };

  const openModal = (doctorId) => {
    setSelectedDoctor(doctorId);
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setSelectedDoctor(null);
    setAppointmentDate('');
    setIsModalOpen(false);
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ textAlign: 'center', color: '#333' }}>Doctors List</h1>
      {doctors.length > 0 ? (
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          {doctors.map((doctor) => (
            <li key={doctor._id} style={{ border: '1px solid #ccc', margin: '10px 0', padding: '10px', borderRadius: '5px' }}>
              <h2 style={{ margin: '5px 0' }}>{doctor.name}</h2>
              <p style={{ margin: '5px 0' }}><strong>Specialty:</strong> {doctor.specialty}</p>
              <p style={{ margin: '5px 0' }}><strong>Email:</strong> {doctor.email}</p>
              <button 
                style={{ padding: '5px 10px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '3px', cursor: 'pointer' }}
                onClick={() => openModal(doctor._id)}
              >
                Book Appointment
              </button>
            </li>
          ))}
        </ul>
      ) : (
        <p style={{ textAlign: 'center', color: '#999' }}>No doctors available</p>
      )}

      <Modal
        isOpen={isModalOpen}
        onRequestClose={closeModal}
        style={{
          content: {
            top: '50%',
            left: '50%',
            right: 'auto',
            bottom: 'auto',
            marginRight: '-50%',
            transform: 'translate(-50%, -50%)',
            padding: '20px',
            borderRadius: '10px',
            width: '300px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)'
          }
        }}
      >
        <h2 style={{ textAlign: 'center', color: '#333' }}>Book Appointment</h2>
        <input
          type="date"
          value={appointmentDate}
          onChange={(e) => setAppointmentDate(e.target.value)}
          style={{ padding: '5px', borderRadius: '3px', border: '1px solid #ccc', marginBottom: '10px', width: '100%' }}
        />
        <br />
        <button 
          onClick={handleBookAppointment}
          style={{ padding: '5px 10px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '3px', cursor: 'pointer', marginRight: '10px', width: '100%', marginBottom: '10px' }}
        >
          Confirm
        </button>
        <button 
          onClick={closeModal}
          style={{ padding: '5px 10px', backgroundColor: '#dc3545', color: 'white', border: 'none', borderRadius: '3px', cursor: 'pointer', width: '100%' }}
        >
          Cancel
        </button>
      </Modal>
    </div>
  );
}

export default PatientDashboard;
